import { Interface, getBytes } from "ethers";

// Define the ABI for the `createAccount` function
const abi = [
  "function createAccount(bytes[] owners, uint256 nonce) payable returns (address account)"
];
const iface = new Interface(abi);

// Define the call data
const calldata = "";

// Decode the call data
const decodedData = iface.decodeFunctionData("createAccount", getBytes("0x" + calldata.substring(42)));

console.log("Decoded Data:", decodedData);
